//This event is dispatched when an item of the gallery is double clicked.		  
beScript.onUIDoubleClicked = function (iEvent) {								  
	//You can access to the gallery through iEvent.sender						  
	//You can access to the clicked item index through iEvent.index				  

	//Retrieve the camera of the clicked item									  
	var selectedCamera = this.getActor().items[iEvent.index].camera;			  
	//Set the camera as current													  
	var renderManager = STU.RenderManager.getInstance();						  
	renderManager.setCurrentCamera(selectedCamera);								  
};																				  
